// LLM Data Processing - COMPLETE VERSION with change detection
const prep = $node["Format Client Config"].json || $('Format Client Config').item.json;
const mapping = prep.record_mapping || {};
const aiEnvelope = $json || {};
const raw = (typeof aiEnvelope.output !== 'undefined') ? aiEnvelope.output : aiEnvelope;

// Parse AI output
let updates = [];
if (raw && typeof raw === 'string') {
  try {
    const arr = JSON.parse(raw);
    if (Array.isArray(arr)) {
      arr.forEach(it => {
        const idx0 = Number(it.index) - 1;
        const info = mapping[idx0];
        if (info) {
          const correctedText = it.corrected_text || info.original_text;
          const changesMade = correctedText.trim() !== info.original_text.trim();

          updates.push({
            record_id: info.record_id,
            original_text: info.original_text,
            corrected_text: correctedText,
            changes_made: changesMade,
            change_note: it.change_note || 'DeÄŸiÅŸiklik yok'
          });
        }
      });
    }
  } catch(e) {
    console.log('Parse error:', e.message);
  }
}

// Calculate statistics
const changedTexts = updates.filter(u => u.changes_made).length;
const unchangedTexts = updates.filter(u => !u.changes_made).length;

// Build Airtable payload with proper field updates
const airtableRecords = updates.map(u => ({
  id: u.record_id,
  fields: {
    "Ä°ÅŸlendi": true,
    "DeÄŸiÅŸiklik Notu": u.change_note,
    "DeÄŸiÅŸtirildi": u.changes_made ? "Evet" : "HayÄ±r",
    "DÃ¼zenlenmiÅŸ Metin": u.corrected_text
  }
})).concat(
  (prep.empty_text_record_ids || []).map(id => ({
