    }
  }))
);

console.log("ðŸ“ Processing results:");
console.log(`   â€¢ Total updates: ${updates.length}`);
console.log(`   â€¢ Changed: ${changedTexts}`);
console.log(`   â€¢ Unchanged: ${unchangedTexts}`);
console.log(`   â€¢ Empty text records: ${prep.empty_text_record_ids?.length || 0}`);

return {
  json: {
