    ready_for_update: true,
    updates,
    total_updates: updates.length,
    changes_made: changedTexts,
    no_changes: unchangedTexts,
    execution_id: prep.execution_id,
    ai_thread_id: aiEnvelope.threadId || null,
    processed_at: new Date().toISOString(),
    empty_text_record_ids: prep.empty_text_record_ids || [],

    // Pass through processing_info for Airtable Update
    processing_info: {
      table_id: prep.table_id,
