// ðŸ“Š TEXT PROCESSING LOGGER
// This node logs text processing activities to Supabase

// Get data from previous nodes
const llmProcessingOutput = $node["LLM Data Processing"].json;
const textDataPrep = $node["Format Client Config"].json;
const airtableBatchUpdate = $node["Airtable Batch Update"].json;

// Calculate processing duration
const processingStart = new Date(textDataPrep.processed_at || new Date());
const processingEnd = new Date();
const processingDuration = processingEnd.getTime() - processingStart.getTime();

// Get current date for generation_date
const currentDate = new Date();
const generationDate = currentDate.toISOString().split('T')[0]; // Format: YYYY-MM-DD

// Analyze processing results
const updatesData = llmProcessingOutput.updates || [];
const changedTexts = updatesData.filter(update => update.changes_made).length;
const unchangedTexts = updatesData.filter(update => !update.changes_made).length;

// Determine processing status
let processingStatus = 'completed';
let errorMessage = null;

if (textDataPrep.error) {
  processingStatus = 'failed';
  errorMessage = textDataPrep.message || 'Unknown error';
} else if (changedTexts === 0 && unchangedTexts === 0) {
  processingStatus = 'failed';
  errorMessage = 'No texts were processed successfully';
} else if (updatesData.length < textDataPrep.valid_texts_count) {
  processingStatus = 'partial';
  errorMessage = `Only ${updatesData.length} out of ${textDataPrep.valid_texts_count} texts were processed`;
}

// Analyze Airtable update results
let airtableSuccessful = 0;
let airtableFailed = 0;

try {
  if (airtableBatchUpdate && airtableBatchUpdate.records) {
    airtableSuccessful = Array.isArray(airtableBatchUpdate.records) ? 
                       airtableBatchUpdate.records.length : 1;
  } else if (airtableBatchUpdate && !airtableBatchUpdate.error) {
    airtableSuccessful = updatesData.length;
  } else {
    airtableFailed = updatesData.length;
  }
} catch (error) {
  console.log(`âš ï¸ Could not analyze Airtable results: ${error.message}`);
  airtableFailed = updatesData.length;
}

// Build the log entry
const logEntry = {
  // Client & Business context (from Text Data Preparation - flat structure)
  client_id: textDataPrep.client_id,
  business_name: textDataPrep.business_name,
  table_id: textDataPrep.table_id,

  // Processing Details
  execution_id: textDataPrep.execution_id,
  button_type: 'TEXT_EDIT',
  generation_date: generationDate,

  // Content metrics
  total_records_found: textDataPrep.total_records,
  texts_processed: updatesData.length,
  texts_changed: changedTexts,
  texts_unchanged: unchangedTexts,

  // AI Processing details
  ai_model: 'openai_assistant',
  ai_thread_id: llmProcessingOutput.ai_thread_id || null,
  processing_duration_ms: processingDuration,

  // Processing status
  status: processingStatus,
  error_message: errorMessage,

  // Airtable update results
  airtable_updates_successful: airtableSuccessful,
  airtable_updates_failed: airtableFailed,

  // Metadata
  created_by: 'n8n_automation',
  processed_at: new Date().toISOString()
};

console.log(`ðŸ“Š Logging text processing for ${logEntry.business_name}:`);
console.log(`ðŸ“¤ Execution: ${logEntry.execution_id}`);
console.log(`ðŸ“Š Stats: ${logEntry.texts_processed} processed, ${logEntry.texts_changed} changed, ${logEntry.texts_unchanged} unchanged`);
console.log(`ðŸ“… Date: ${logEntry.generation_date}`);
console.log(`â±ï¸ Duration: ${Math.round(logEntry.processing_duration_ms / 1000)}s`);
console.log(`ðŸ“Œ Status: ${logEntry.status}`);

if (logEntry.error_message) {
  console.log(`âš ï¸ Error: ${logEntry.error_message}`);
}

// Return the log entry for Supabase
return [{
  json: logEntry
}];

// Extract Webhook Data - Handle Aggregate wrapper for Proofreading
const input = $input.item.json;

let payload;

// Handle different wrapper structures
if (Array.isArray(input.airtabledata)) {
    // Proofreading format: [{ airtabledata: [{ body: {...} }] }]
    payload = input.airtabledata[0].body;
} else if (Array.isArray(input.data)) {
    // PDF format: [{ data: [{ body: {...} }] }]
    payload = input.data[0].body;
} else if (input.body) {
    // Direct webhook format: { body: {...} }
    payload = input.body;
} else {
    // Legacy format: direct payload
    payload = input;
}

console.log('Extracted client_name:', payload.client_name);
console.log('Records count:', payload.records?.length);

// Validate required fields
if (!payload.client_name) {
    throw new Error('Missing client_name in payload');
}

return {
    client_name: payload.client_name,
    table_name: payload.table_name,
    button_type: payload.button_type,
    records: payload.records || [],
    emptyTextRecordIds: payload.emptyTextRecordIds || [],
    timestamp: payload.timestamp
};

// ============================================================================
// MINIMAL ERROR HANDLER - Extract client + pass to Error Support
// ============================================================================

const error = $json;
const workflowInfo = $workflow;
const executionInfo = $execution;

// Extract error message
let errorMessage = "Unknown error occurred";
if (typeof error === 'string') {
  errorMessage = error;
} else if (error?.message) {
  errorMessage = error.message;
} else {
  errorMessage = JSON.stringify(error);
}

// Get client from webhook (if available)
let clientName = "unknown";
try {
  const webhookData = $('Extract Webhook Data')?.item?.json;
  if (webhookData?.client_name) {
    clientName = webhookData.client_name;
  }
} catch (e) {
  // No webhook data available
}

// Simple payload for Error Support
return {
  error_message: errorMessage,
  error_stack: error.stack || null,
  workflow_name: workflowInfo.name,
  workflow_id: workflowInfo.id,
  execution_id: executionInfo.id,
  client_name: clientName, // â† Just this from webhook
  timestamp: new Date().toISOString()
};

// ============================================================================
// FORMAT CLIENT CONFIG - Proofread Adapter
// ============================================================================

const webhookData = $('Extract Webhook Data').item.json;
const supabaseResult = $json;

console.log(`ðŸ” CLIENT REGISTRY LOOKUP (Proofread)`);
console.log(`   Client: ${webhookData.client_name}`);

// ============================================================================
// VALIDATION
// ============================================================================

if (!supabaseResult || (Array.isArray(supabaseResult) && supabaseResult.length === 0)) {
  throw new Error(`CLIENT_NOT_FOUND: ${webhookData.client_name} not in registry or inactive`);
}

const clientConfig = Array.isArray(supabaseResult) ? supabaseResult[0] : supabaseResult;

if (!clientConfig.active) {
  throw new Error(`CLIENT_INACTIVE: ${webhookData.client_name}`);
}

console.log(`âœ… Client config loaded: ${clientConfig.instagram_page_name}`);

// ============================================================================
// FORMAT OUTPUT - Proofread Format
// ============================================================================

return {
  ...webhookData,

  // Client configuration
  client_config: {
    client_id: clientConfig.client_identifier,
    business_name: clientConfig.instagram_page_name,
    table_id: clientConfig.airtable_table_id,
    airtable_base: clientConfig.airtable_base_id,
    telegram_chat_id: clientConfig.telegram_channel_id
  },

  // Expose fields
  client_id: clientConfig.client_identifier,
  business_name: clientConfig.instagram_page_name
};
